#define NUM_RECTS 8

#define WIDTH 320
#define HEIGHT 240
#define DIM 12	
enum DIRECTION { UL, UR, DL, DR };

typedef struct Rect {

    int x, px; int y, py;
    int velX;
    int velY;
    int size;
    int colour;
    struct Rect* next;

} Rect;

void handle_bounds(Rect*);
void handle_drawing();
void draw_sqr(int x, int y, int sz, int);
void update_rects();
void init_rects();

void draw_line(int x0, int y0, int x1, int y1, int colour);
void plot_pixel(int x, int y, short int line_color);
void drawWinnerScreen();
void mod_cls();
void swap(int*, int*);
void await_vsync();
void swap_buffers();

int colour = 0x7e0;
volatile int pixel_buffer_start; // global variable

int locY = 1, acc = 1;
volatile int* pixel_ctrl_ptr = (int*)0xFF203020;



Rect rects[NUM_RECTS];

int main(void)
{

    init_rects();

    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = (int)0xC8000000; // first store the address in the 			

    for (int i = 0; i < WIDTH; i++)

        for (int j = 0; j < HEIGHT; j++)

            plot_pixel(i, j, 0);

    /* now, swap the front/back buffers, to set the front buffer location */
    await_vsync();

    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;

    *(pixel_ctrl_ptr + 1) = (int)0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer	

    for (int i = 0; i < WIDTH; i++)

        for (int j = 0; j < HEIGHT; j++)

            plot_pixel(i, j, 0);


    /* set back pixel buffer to start of SDRAM memory */


    while (true) {

       drawWinnerScreen();

        await_vsync();

        swap_buffers();


    }

}


void handle_drawing() {

    update_rects();

}

//change the position. If going out of bounds then change the directions
void update_rects() {

    for (int i = 0; i < NUM_RECTS; i++) {

        rects[i].px = rects[i].x;
        rects[i].py = rects[i].y;
        rects[i].x += rects[i].velX;
        rects[i].y += rects[i].velY;
        handle_bounds(&rects[i]);

        draw_sqr(rects[i].x, rects[i].y, rects[i].size, rects[i].colour);

    }

    for (int i = 0; i < NUM_RECTS; i++)

        draw_line(rects[i].x, rects[i].y, rects[i].next->x, rects[i].next->y, rects[i].colour);

}

void handle_bounds(Rect* rect) {

    if ((rect->x + rect->size) >= WIDTH && rect->velX > 0) {

        rect->velX = -rect->velX;

    }

    else if ((rect->x) <= 0 && rect->velX < 0) {

        rect->velX = -rect->velX;

    }

    if ((rect->y + rect->size) >= HEIGHT && rect->velY > 0) {

        rect->velY = -rect->velY;

    }

    else if ((rect->y) <= 0 && rect->velY < 0) {

        rect->velY = -rect->velY;

    }

}

int cols[8] = { 0x001F, 0x07E0, 0xF800, 0xFFF3, 0x001F, 0x89ab, 0x1234, 0x5678 };

void init_rects() {

    for (int i = 0; i < NUM_RECTS; i++) {

        rects[i].x = rand() % (WIDTH - DIM);
        rects[i].y = rand() % (HEIGHT - DIM);
        rects[i].px = rects[i].x;
        rects[i].py = rects[i].y;
        rects[i].velX = (rand() % DIM) + 1;
        rects[i].velY = (rand() % DIM) + 1;

        if (rand() % 2) {

            //add some spice still
            rects[i].velX = -rects[i].velY;
            rects[i].velY = -rects[i].velX;
        }

        rects[i].size = DIM;
        rects[i].colour = *(&cols[0] + rand() % NUM_RECTS);

        if (i != NUM_RECTS - 1) rects[i].next = (Rect*)(&rects[i] + 1);
        else rects[i].next = (Rect*)&rects[0];

    }

}

void await_vsync() {

    volatile int* ptr = (int*)0xff203020;
    register int status;

    *ptr = 1;
    status = *(ptr + 3);

    while ((status & 0x01) != 0) {

        status = *(ptr + 3);

    }

}

unsigned int rrr(unsigned int r, unsigned int g, unsigned int b) {
    return ((r << 10) + (g << 4) + b);
}

void drawWinnerScreen() {

    int i = 0, j = 0;

    for (int k = 0; k < 320 * 2 * 240 - 1; k += 2) {


        int red = ((winnerScreen[k + 1] & 0xF8) >> 3) << 11;
        int green = (((winnerScreen[k] & 0xE0) >> 5)) | ((winnerScreen[k + 1] & 0x7) << 3);

        int blue = (winnerScreen[k] & 0x1f);

        short int p = red | ((green << 5) | blue);

        plot_pixel(0 + i, j, p);

        i += 1;
        if (i == 320) {
            i = 0;
            j += 1;
        }

    }



}

void swap_buffers() {

    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	

}

void mod_cls() {

    for (int i = 0; i < NUM_RECTS; i++) {

        draw_sqr(rects[i].px, rects[i].py, rects[i].size, 0);
        draw_line(rects[i].px, rects[i].py, rects[i].next->px, rects[i].next->py, 0);

    }

}


void plot_pixel(int x, int y, short int line_color)
{
    if (x < 0) x = 0;
    else if (x > WIDTH) x = WIDTH;

    if (y < 0) y = 0;

    else if (y > HEIGHT) y = HEIGHT;

    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_line(int x0, int y0, int x1, int y1, int colour) {

    bool steep = abs(y1 - y0) > abs(x1 - x0);

    if (steep) {

        swap(&x0, &y0);
        swap(&x1, &y1);

    }

    if (x0 > x1) {

        swap(&x0, &x1);
        swap(&y0, &y1);

    }

    int dx = x1 - x0;
    int dy = abs(y1 - y0);
    int error = -(dx / 2);
    int y = y0;
    int y_step = 0;

    if (y0 < y1) {

        y_step = 1;

    }

    else y_step = -1;


    for (int x = x0; x < x1 + 1; x++) {

        if (steep) plot_pixel(y, x, colour);

        else {

            plot_pixel(x, y, colour);

        }

        error = error + dy;

        if (error >= 0) {

            y += y_step;

            error -= dx;

        }
    }



}

//swap two variables
inline void swap(int* a, int* b) {

    int temp = *a;

    *a = *b;

    *b = temp;

}

void draw_sqr(int x, int y, int sz, int col) {

    for (int i = 0; i < sz; i++) {

        for (int j = 0; j < sz; j++) {

            plot_pixel(x + i, y + j, col);

        }

    }

}